import React from 'react';
import { useLocalState } from '../util/useLocalStorage';
import ValidateToken from '../services/validatetoken';
import { LogOut } from '../services/LogOut';
import Settings from '../Settings';
import Checkrole from '../services/Checkrole';



const User = () => {
    const [jwt,setJwt] = useLocalState("", "jwt");

  
    if(Checkrole() !== "USER"){
        if(Checkrole() === "EMPLOYEE"){
            window.location.href = "/employee";
        }
        else if(Checkrole() === "ADMIN"){
            window.location.href = "/admin";
        }
        else{
            window.location.href = "/welcome";
        }
    }
    
    return (
        <div>

            <h1>Usao si</h1>
            <div>jtw is {jwt}</div>
            <div>
            <button id="logout" type="button" onClick={() => LogOut()}>LogOut</button>
            </div>

            <div>
            <button id="settings" type="button" onClick={() => window.location.href = "/settings"}>Settings</button>
            </div>

        </div>
    );
};

export default User;
